import styled from "styled-components";

const HeaderLeft = () => {
  return <Title>Mini Trello</Title>;
};

let Title = styled.div`
  font-family: "Paprika";
  font-size: 40px;
  padding-top: 80px;
  padding-left: 70px;
  padding-bottom: 70px;
`;

export default HeaderLeft;
